import { ImSearch, ImPlus } from 'react-icons/im';

export const Searchbar = () => {
  return (
    <>
      <SearchbarForm>
        <button type="submit">
          <ImSearch size={14} />
        </button>
        <input
          name="inputData"
          //   value={}
          // onChange={}
          type="text"
          autoFocus
          autoComplete="off"
          placeholder="Search for a city"
        />
        <button type="onClick">
          <ImPlus size={14} />
        </button>
      </SearchbarForm>
    </>
  );
};
